import React,{useState,useEffect} from 'react';
import './App.css';

function App() {
  const [data,setData]=useState([]);
  const getData=()=>{
    fetch('./data.json'
    ,{
      headers : { 
        'Content-Type': 'application/json',
        'Accept': 'application/json'
       }
    }
    )
      .then(function(response){
        console.log(response)
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson);
        setData(myJson)
      });
  }

  useEffect(()=>{
    getData()
  },[])

  return (
    <div className="App">
    <table className="box">
        <tr>
          <th>id</th>
          <th>firstname</th>
          <th>lastname</th>
          <th>age</th>
          <th>city</th>
          <th>address</th>
        </tr>         
    {
      data.map(data => {
        return (
          <tr>
              <td>{data['id']}</td>
              <td>{data['lastname']}</td>
              <td>{data['firstname']}</td>
              <td>{data['age']}</td>
              <td>{data['city']}</td>
              <td>{data['address']}</td>
          </tr>           
        )
      })
    }     
    </table>
  </div>
    // <div className="App">
